(window.webpackJsonp=window.webpackJsonp||[]).push([[836],{1133:function(n){n.exports={content:'<h2>nano-memoize \u548c fast-memoize</h2>\n<p>\u9996\u5148\uff0c\u8fd92\u4e2a\u5de5\u5177\u7684\u5b9e\u73b0\u6e90\u7801\u662f\u6781\u5176\u76f8\u4f3c\u7684\uff0c\u57fa\u672c\u4e0a\uff0c\u53ea\u8981\u9605\u8bfb\u4e86\u5176\u4e2d\u4e00\u4e2a\u6e90\u7801\uff0c\u4e5f\u5c31\u4e86\u89e3\u4e86\u53e6\u5916\u4e00\u4e2a\u7684\u5b9e\u73b0\u3002</p>\n<p>fast-memoize\u5bfc\u56fe\uff1a\n<img src="https://stonehank.github.io/articles/img/fast-memoize.png" alt=""></p>\n<p>\u5927\u6982\u8bf4\u8bf4\u5b83\u4eec\u7684\u5b9e\u73b0\u601d\u8def\uff1a</p>\n<ol>\n<li>\u5b9a\u4e49\u7f13\u5b58\u7ed3\u6784\uff0c\u5176\u4e2d<code>fast</code>\u4f7f\u7528\u4e86<code>\u65e0prototype\u7684\u5bf9\u8c61</code>\uff0c<code>nano</code>\u4f7f\u7528\u4e86<code>\u666e\u901a\u5bf9\u8c61</code>\u3002</li>\n<li>\u5b9a\u4e49\u5e8f\u5217\u5316\u65b9\u6cd5\uff1a\u5f53\u68c0\u6d4b\u5230\u662f\u5355\u53c2\u6570\u65f6\uff0c\u90fd\u662f\u9009\u62e9JSON.stringify\uff0c\u800c\u591a\u4e2a\u53c2\u6570\uff0c\u4e24\u8005\u6709\u4e0d\u540c\uff08\u540e\u9762\u518d\u8bf4\uff09\u3002</li>\n<li>\u5b9a\u4e49\u7b56\u7565\uff1a\u4e5f\u5c31\u662f\u7f13\u5b58\u7684\u5177\u4f53\u65b9\u6cd5\uff0c\u5176\u5b9e\u5f88\u7b80\u5355\uff0c\u5c31\u662f\u5bf9\u5f53\u524d\u7f13\u5b58\u7ed3\u6784\u67e5\u627e\uff0c\u627e\u5230\u5c31\u8fd4\u56de\uff0c\u627e\u4e0d\u5230\u5c31\u91cd\u65b0\u8fd0\u884c\uff0c\n\u4e24\u8005\u90fd\u4f7f\u7528\u4e86<code>bind</code>\u65b9\u6cd5\u6ce8\u5165\u53c2\u6570\uff0c\u53ef\u4ee5\u7701\u53bb\u8fd0\u884c\u65f6\u518d\u53bb\u67e5\u627e\u53c2\u6570\u3002</li>\n</ol>\n<p>\u63a5\u7740\u5206\u6790\u4e24\u8005\u7684\u5f02\u540c\uff1a</p>\n<p>\u76f8\u540c\u5904\uff1a</p>\n<ul>\n<li>\u90fd\u4f7f\u7528\u4e86<code>JSON.stringify</code>\u4f5c\u4e3a\u5e8f\u5217\u5316\u65b9\u6cd5\uff0c\u56e0\u4e3a\u5b83\u662f\u539f\u751f\u7684\u3002</li>\n<li>\u90fd\u5bf9\u8fd4\u56de\u7684\u7f13\u5b58\u51fd\u6570\u8fdb\u884c\u4e86\u53c2\u6570\u6ce8\u5165\uff08\u8fd9\u662f\u4e00\u4e2a\u6781\u5927\u63d0\u5347\u6027\u80fd\u7684\u65b9\u6cd5\uff09\u3002</li>\n<li>\u5bf9\u5355\u53c2\u6570\u8fd8\u662f\u591a\u53c2\u6570\u7684\u5224\u65ad\u90fd\u662f\u4f7f\u7528<code>func.length</code>(\u5f62\u53c2\u7684\u6570\u91cf\u5224\u65ad)\uff0c\u56e0\u4e3a<code>func.length</code>\u6bd4<code>arguments.length</code>\u8fd9\u79cd\u52a8\u6001\u5224\u65ad\u6027\u80fd\u4f1a\u597d\u5f88\u591a\u3002</li>\n</ul>\n<p>\u4e0d\u540c\u70b9\uff1a</p>\n<ul>\n<li><code>fast</code>\u4f7f\u7528\u4e86<code>\u65e0prototype\u7684\u5bf9\u8c61</code>\uff0c<code>nano</code>\u4f7f\u7528\u4e86<code>\u666e\u901a\u5bf9\u8c61</code>(\u8fd9\u4e00\u70b9\u6027\u80fd\u4e0a\u76f8\u5dee\u4e0d\u591a)\u3002</li>\n<li>\u5f53\u9047\u5230\u591a\u4e2a\u53c2\u6570\u65f6\uff0c<code>fast</code>\u8fd8\u662f\u7ee7\u7eed\u5bf9<code>arguments</code>\u8fdb\u884c\u5e8f\u5217\u5316\uff0c\u800c<code>nano</code>\u5219\u590d\u6742\u4e00\u70b9\uff0c\u5b83\u901a\u8fc7\u7528\u6570\u7ec4\u5c06\u6bcf\u4e00\u6b21\u591a\u4e2a\u53c2\u6570\u4fdd\u5b58\u8d77\u6765\uff0c\n\u540e\u7eed\u901a\u8fc7\u904d\u5386\u6bcf\u4e2a\u53c2\u6570\u8fdb\u884c\u5168\u7b49\u5bf9\u6bd4<code>===</code>\uff0c\u5224\u65ad\u662f\u5426\u4ece\u7f13\u5b58\u8c03\u53d6\u7ed3\u679c\u3002</li>\n<li>\u540c\u6837\u662f\u591a\u4e2a\u53c2\u6570\uff0c<code>nano</code>\u589e\u52a0\u4e86\u4e00\u4e2a\u53c2\u6570max\uff0c\u53ef\u4ee5\u8ba9\u7528\u6237\u81ea\u5b9a\u4e49\u9700\u8981\u8fdb\u884c\u5bf9\u6bd4\u53c2\u6570\u7684\u957f\u5ea6\u3002</li>\n</ul>\n<p><a href="https://github.com/stonehank/sourcecode-analysis/blob/master/source-code.fast-memoizeVSnano-memoize/README.md">\u66f4\u8be6\u7ec6\u7684\u8bf4\u660e\u548c\u6df1\u5165\u7406\u89e3\uff0c\u53ef\u67e5\u770b\u6e90\u7801\u5b66\u4e60\u2014\u2014fast,nano</a></p>\n<p>\u5047\u8bbe\uff1a</p>\n<ul>\n<li>\u5ffd\u7565===\u7684\u6267\u884c\u65f6\u95f4</li>\n<li>\u4f7f\u7528\u7684\u53c2\u6570\u5206\u4e3a \u5f15\u7528\u76f8\u540c \u548c \u5f15\u7528\u4e0d\u540c(\u4f46\u662f\u6df1\u6bd4\u8f83\u4e3atrue)</li>\n</ul>\n<table>\n<thead>\n<tr>\n<th><em>\u8017\u65f6\u64cd\u4f5c</em></th>\n<th><em>\u591a\u4e2a\u53c2\u6570(\u5f15\u7528\u76f8\u540c)</em></th>\n<th></th>\n<th><em>\u591a\u4e2a\u53c2\u6570(\u5f15\u7528\u4e0d\u540c)</em></th>\n<th></th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>\u72b6\u6001</td>\n<td>\u9996\u6b21\u8fd0\u884c</td>\n<td>\u540e\u7eed\u8fd0\u884c</td>\n<td>\u9996\u6b21\u8fd0\u884c</td>\n<td>\u540e\u7eed\u8fd0\u884c</td>\n</tr>\n<tr>\n<td>fast</td>\n<td>\u5e8f\u5217\u5316+\u8fd0\u884c</td>\n<td>\u5e8f\u5217\u5316</td>\n<td>\u5e8f\u5217\u5316+\u8fd0\u884c</td>\n<td>\u5e8f\u5217\u5316</td>\n</tr>\n<tr>\n<td>nano</td>\n<td>\u8fd0\u884c</td>\n<td>0</td>\n<td>\u8fd0\u884c</td>\n<td>\u8fd0\u884c</td>\n</tr>\n</tbody>\n</table>\n'}}}]);
